import React from 'react';
import styles from '../Education.module.css';

const Education = () => {
    return (
        <div className="education container">
            <h2>Education</h2>
            <div className="education-item">
                <h3>Mesa Community College</h3>
                <p>Associates in Applied Science, Administration of Justice | 2003 - 2006</p>
            </div>
            <div className="education-item">
                <h3>Mesa High School</h3>
                <p>High School, General Studies | 2000 - 2003</p>
                <p>Grade: A</p>
                <p>Activities and societies: JV and Varsity Basketball Team, Computer Technology</p>
            </div>
        </div>
    );
};

export default Education;
